import { useEffect, Fragment } from 'react';
import CssBaseline from '@mui/material/CssBaseline';
import Container from '@mui/material/Container';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import LintechPicture from './assets/1673710275502.jpeg';

const Login = () => {
    return (
        <Fragment>
            <CssBaseline />
            <Container maxWidth="lg">
                <Grid container justifyContent="center" alignItems="center">
                    {/* <Box style={{ height: '75vh', width: '75vh', marginTop: '10%'}} sx={{ boxShadow: 5 }}>
                        <Typography
                            variant="h6"
                            noWrap
                            sx={{
                            mr: 2,
                            display: { xs: 'none', md: 'flex' },
                            fontFamily: 'monospace',
                            fontWeight: 700,
                            letterSpacing: '.3rem',
                            color: 'inherit',
                            textDecoration: 'none',
                            }}
                        >
                            LinTech üêÑ  ü•¨  Output Tracker
                        </Typography>
                    </Box> */}
                        <Card sx={{ height: '75vh', width: '75vh', marginTop: '10%', boxShadow: 10 }}>
                            <CardMedia
                                sx={{ height: '35vh'}}
                                image={LintechPicture}
                                title="Samgyup"
                            />
                            <CardContent>
                                <Typography
                                    variant="h6"
                                    noWrap
                                    sx={{
                                    mr: 2,
                                    display: { xs: 'none', md: 'flex' },
                                    fontFamily: 'monospace',
                                    fontWeight: 700,
                                    letterSpacing: '.3rem',
                                    color: 'inherit',
                                    textDecoration: 'none',
                                    }}
                                >
                                    LinTech üêÑ  ü•¨ Output Tracker
                                </Typography>
                                <Typography variant="body2" color="text.secondary">
                                    Pang track ng oras para hindi pagalitan ng MEAL
                                </Typography>
                                <TextField
                                    required
                                    id="outlined-required"
                                    label="Required"
                                />
                                <TextField
                                    required
                                    id="outlined-required"
                                    label="Required"
                                />
                            </CardContent>
                            <CardActions sx={{justifyContent: "flex-end", mr: 3}}>
                                <Button variant="contained" size="medium">Login</Button>
                            </CardActions>
                        </Card>
                </Grid>
            </Container>
        </Fragment>
    )
}

export default Login;
